import React from "react";
import { Link } from "react-router-dom";

const Anasayfa = () => {
  return (
    <div style={{ backgroundColor: "#CE2829", minHeight: "200vh" }}>
      <h1 style={{ textAlign: "center", marginTop: "50px",color:"white",fontFamily:"Barlow,sans-serif",fontWeight:"Bold" }}>
        Teknolojik Yemekler
      </h1>
      <p style={{textAlign: "center", marginTop: "100px", color:"white", fontSize:"40px"}}>
  KOD ACIKTIRIR <br />PIZZA DOYURUR
</p>

      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Link
          to="/siparis-ver"
          className="button"
          style={{
            backgroundColor: "#FDC913",
            color: "black",
            padding: "15px 80px",
            borderRadius: "30px",
            fontSize: "24px",
            textDecoration: "none",
            textTransform: "uppercase",
          }}
        >
          Acıktım
        </Link>
      </div>
      <div style={{ position: "absolute", bottom: "0", width: "100%" }}>
        <img
          src="Assets/adv-aseets/food-2.png"
          alt="yemek resmi"
          style={{position: "absolute",bottom: "0",left: "0" ,width:"100%", height:"50%", objectFit: "cover"}}
        />
      </div>
    </div>
  );
};

export default Anasayfa;
